import React, { useEffect } from "react";
import PropTypes from "prop-types";
import { Paper, makeStyles, Grid, Button } from "@material-ui/core";
import { useDispatch, connect } from "react-redux";
import TextField from "@material-ui/core/TextField";
import InputLabel from "@material-ui/core/InputLabel";
import MenuItem from "@material-ui/core/MenuItem";
import FormControl from "@material-ui/core/FormControl";
import Select from "@material-ui/core/Select";

import UploadFile from "components/shared/upload/uploadFile";
import { setUploadedImageURL } from "redux/actions/common";
import { fetchAllHealthTopics } from "apiRequests/common";

const useStyles = makeStyles((theme) => ({
  pageContent: {
    marginTop: "3rem",
    margin: theme.spacing(3),
    padding: theme.spacing(3),
  },
}));
const Documents = ({ fetchAllHealthTopics, healthTopics }) => {
  const classes = useStyles();
  const dispatch = useDispatch();

  useEffect(() => {
    fetchAllHealthTopics();
  }, []);
  return (
    <>
      <Button
        variant="contained"
        color="secondary"
        style={{
          color: "#ffffff",
          textTransform: "none",
          width: "fit-content",
          margin: "1rem 1.5rem",
        }}
        onClick={() => {
          history.goBack();
          dispatch(setUploadedImageURL(""));
        }}
      >
        Go back
      </Button>
      <Paper className={classes.pageContent}>
        <Grid container>
          <Grid
            item
            xs={12}
            md={6}
            lg={6}
            xl={6}
            // style={{
            //   display: "flex",
            //   flexDirection: "column",
            //   justifyContent: "center",
            //   alignItems: "center",
            // }}
          >
            <UploadFile />
          </Grid>
          <Grid
            item
            xs={12}
            md={6}
            lg={6}
            xl={6}
            style={{
              display: "flex",
              flexDirection: "column",
            }}
          >
            <TextField
              id="document_name"
              label="Document name"
              error={false}
              helperText="Some important text"
              variant="outlined"
            />
            <FormControl variant="outlined" className={classes.formControl}>
              <InputLabel id="demo-simple-select-filled-label">
                Document related health topic
              </InputLabel>
              <Select
                labelId="demo-simple-select-filled-label"
                id="demo-simple-select-filled"
                // value={age}
                // onChange={handleChange}
              >
                <MenuItem value="">
                  <em>None</em>
                </MenuItem>
                {healthTopics.map((topic) => (
                  <MenuItem value={topic.healthTopicId}>{topic.title}</MenuItem>
                ))}
              </Select>
            </FormControl>
          </Grid>
        </Grid>
      </Paper>
    </>
  );
};

Documents.propTypes = {
  fetchAllHealthTopics: PropTypes.func,
};

const mapStateToProps = (state) => ({
  healthTopics: state.common.healthTopics,
});
const mapDispatchToProps = (dispatch) => ({
  fetchAllHealthTopics: () => dispatch(fetchAllHealthTopics()),
});

export default connect(mapStateToProps, mapDispatchToProps)(Documents);
